import React from 'react';
import { NavLink, Switch, Route } from 'react-router-dom';

const Main = () => (
    <Switch>
        <Route exact path='/'>
            <Home />
        </Route>
        <Route exact path='/about'>
            <About />
        </Route>
        <Route exact path='/contact' component={Contact}>
            <Contact />
        </Route>
    </Switch>
);

export default Main;
